      <div className="r5c1-content-div">
        <span className="r5c1-content-txt-span">
          <p className="vehicletroller-1-p6">Vehicle:troller 1</p>
          <p className="vehicletroller-1-p6">Sáng: MCP 1, 2</p>
          <p className="chiu-mcp-31">Chiều: MCP 3</p>
        </span>
      </div>
      <div className="r5c1-text-div">26</div>
    </div>
  );
};

export default R5c1Copy;
